package week5MondayRecap;

public class ForLoop7_NestedLoop2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 0; i <= 10; i++) {
			for (int j = 1; j <= 10; j++) {
				System.out.print(j + " ");
			}
			System.out.println();
		}

	}

}
